pragma solidity 0.6.6;
pragma experimental ABIEncoderV2;

interface CarCollectible{
    struct Attr {
        string brand;
        string model;
        uint16 year;
        uint32 price;
        uint16 iot_account;
    }
    function check_ownership(uint256 tokenId) external view returns (address);
    function get_attributes(uint256 tokenId) external view returns(Attr memory attr);
}

contract Insurance{

    CarCollectible public cc_address;
    CarCollectible.Attr attr;
    address sender;

    constructor () public
    {
        cc_address = CarCollectible(0x558f1f19CC21E1Fee2b6269E381A6Ba3765478A0);
    }

    function set_sender() external
    {
        sender = msg.sender;
    }

     function check_ownership(uint256 tokenId) external view returns (bool)
     {
        address owner = cc_address.check_ownership(tokenId);
        if(owner==sender) {
            return true;
        } else {
            return false;
        }
        //return sender;
     }

    function get_metadata(uint256 tokenId) external view returns (CarCollectible.Attr memory attr)
    {
        return cc_address.get_attributes(tokenId);
    }
}
